/*Table structure for table `community_activity` */

DROP TABLE IF EXISTS `community_activity`;

CREATE TABLE `community_activity` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `activity_name` varchar(60) DEFAULT NULL COMMENT '活动名称',
  `activity_time` timestamp NULL DEFAULT NULL COMMENT '活动开始时间',
  `activity_place` varchar(60) DEFAULT NULL COMMENT '活动地点',
  `registration_fee` decimal(10,2) DEFAULT NULL COMMENT '报名费',
  `time_interval` timestamp NULL DEFAULT NULL COMMENT '定时发布时间',
  `publish_state` int(10) DEFAULT '0' COMMENT '发布状态默认0下架;1发布',
  `activity_state` int(10) DEFAULT '1013010' COMMENT '活动状态，默认报名中',
  `is_available` int(11) DEFAULT '1' COMMENT '是否可用:默认0否;1是',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除默认0否，1是',
  `create_user_name` varchar(20) DEFAULT NULL COMMENT '联系人',
  `create_user_phone` varchar(20) DEFAULT NULL COMMENT '联系人电话',
  `surface_picture` varchar(255) DEFAULT NULL COMMENT '封面图',
  `is_time_publish` int(11) DEFAULT '0' COMMENT '是否定时发布默认0否，1是',
  `apply_end_time` timestamp NULL DEFAULT NULL COMMENT '报名截止时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '最后修改时间',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_user_id` bigint(20) DEFAULT NULL COMMENT '最后修改人id',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户ID 类型为活动',
  `qr_ext` varchar(100) DEFAULT NULL COMMENT '二维码后缀',
  `activity_end_time` timestamp NULL DEFAULT NULL COMMENT '活动结束时间',
  `richTextArea` text COMMENT '图文详情',
  `auth_code` varchar(200) DEFAULT NULL COMMENT '管理员授权码',
  `admin_id` bigint(20) DEFAULT '0' COMMENT '作废',
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8mb4 COMMENT='社区活动表';

