  `activity_code` varchar(100) DEFAULT NULL COMMENT '作废',
  `secret` varchar(50) DEFAULT NULL COMMENT '作废',
  `activity_id` bigint(20) DEFAULT NULL COMMENT '活动id',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
