  `creat_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` tinyint(2) DEFAULT '0' COMMENT '是否逻辑删除：0否1是',
  `is_available` tinyint(2) DEFAULT '1' COMMENT '是否是组织者：0否1是',
  `admin_head_url` varchar(100) DEFAULT NULL COMMENT '组织者头像',
  `admin_name` varchar(30) DEFAULT NULL COMMENT '组织者名称',
  `admin_phone` varchar(30) DEFAULT NULL COMMENT '组织者手机号',
  `is_sign` tinyint(2) DEFAULT '0' COMMENT '作废',
  `order_code_id` bigint(20) DEFAULT NULL COMMENT '活动订单id',
