/*Table structure for table `community_activity_order` */

DROP TABLE IF EXISTS `community_activity_order`;

CREATE TABLE `community_activity_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_code` varchar(60) DEFAULT NULL COMMENT '订单编号',
  `user_name` varchar(30) DEFAULT NULL COMMENT '用户姓名',
  `user_phone` int(20) DEFAULT NULL COMMENT '用户手机号',
  `order_source` int(11) DEFAULT NULL COMMENT '订单来源',
  `activity_name` varchar(30) DEFAULT NULL COMMENT '活动名称',
  `activity_time` varchar(60) DEFAULT NULL COMMENT '活动时间',
  `activity_place` varchar(255) DEFAULT NULL COMMENT '活动地点',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `total_amount` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付金额,0.00免费',
  `pay_way` int(11) DEFAULT NULL COMMENT '支付方式',
  `status` int(11) DEFAULT NULL COMMENT '订单状态',
  `is_entry` smallint(2) DEFAULT '0' COMMENT '是否入场0否，1是',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除:默认0未删除;1已删除',
  `is_available` int(11) DEFAULT '0' COMMENT '是否可用:默认0否;1是',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人id/用户id',
  `update_user` bigint(20) DEFAULT NULL COMMENT '修改人id/用户id',
  `bar_num` int(20) DEFAULT NULL COMMENT '扫码的吧台号',
  `bar_area` varchar(20) DEFAULT NULL COMMENT '活动时间转格式',
  `refund_state` int(11) DEFAULT '0' COMMENT '退款状态',
  `isPlus` int(11) DEFAULT '0' COMMENT '时间超时加单 0 否 1是 默认0 (作废)',
  `out_state` int(11) DEFAULT '0' COMMENT '出单状态 0 初始化 1已出单',
  `out_code` int(11) DEFAULT NULL COMMENT '出单号',
  `main_type` int(11) DEFAULT NULL COMMENT '订单大类型 社区/会议室/菜品/扫码',
  `pay_state` int(11) DEFAULT '0' COMMENT '支付状态默认0未支付，1已经支付',
  `pay_time` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `reserve_name` varchar(30) DEFAULT NULL COMMENT '预订人姓名',
  `reserve_phone` varchar(25) DEFAULT NULL COMMENT '预订人手机号',
  `community_activity_id` bigint(20) DEFAULT NULL COMMENT '活动id',
  `surface_picture` varchar(255) DEFAULT NULL COMMENT '缩略图',
  `qr_url` varchar(255) DEFAULT NULL COMMENT '二维码地址',
  `is_admin` int(2) DEFAULT '0' COMMENT '作废',
  `is_sign` int(2) DEFAULT '0' COMMENT '是否签到 0否 1是',
  `sign_time` timestamp NULL DEFAULT NULL COMMENT '签到时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COMMENT='社区活动订单';

