/*Table structure for table `order_pay_notify` */

DROP TABLE IF EXISTS `order_pay_notify`;

CREATE TABLE `order_pay_notify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_code` varchar(60) DEFAULT NULL COMMENT '订单号',
  `source` int(11) DEFAULT NULL COMMENT '来源 0微信 1支付宝',
  `status` int(11) DEFAULT '0' COMMENT '处理状态 0待处理 1已处理',
  `result_code` varchar(60) DEFAULT NULL COMMENT '通知返回状态码 SUCCESS:成功',
  `result_data` varchar(2000) DEFAULT NULL COMMENT '通知返回数据json',
  `create_user` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_time` datetime DEFAULT NULL COMMENT '最后修改时间',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除:默认0未删除;1已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='支付异步通知';

