/*Table structure for table `u_union_config` */

DROP TABLE IF EXISTS `u_union_config`;

CREATE TABLE `u_union_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `company_id` bigint(20) NOT NULL,
  `gateway` int(4) NOT NULL,
  `platform` int(4) NOT NULL COMMENT '1、PC,2、APP,3、H5',
  `app_id` varchar(255) NOT NULL COMMENT 'app_id',
  `app_secret` varchar(255) NOT NULL COMMENT 'app_secret',
  `app_domain` varchar(255) NOT NULL COMMENT '应用域，针对同一公司下的多个应用',
  `redirect_uri` varchar(255) NOT NULL COMMENT '跳转链接',
  `status` int(2) NOT NULL DEFAULT '1' COMMENT '状态(0、禁用 1、启用)',
  `update_time` timestamp NULL DEFAULT NULL,
  `delete_time` timestamp NULL DEFAULT NULL,
  `create_user_id` bigint(20) DEFAULT NULL,
  `update_user_id` bigint(20) DEFAULT NULL,
  `delete_user_id` bigint(20) DEFAULT NULL,
  `is_deleted` int(4) DEFAULT '0' COMMENT '是否删除：0：否；1：是；',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='联合登录配置表';

