  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `update_time` timestamp NULL DEFAULT NULL,
  `delete_time` timestamp NULL DEFAULT NULL,
  `create_user_id` bigint(20) DEFAULT NULL,
  `update_user_id` bigint(20) DEFAULT NULL,
  `delete_user_id` bigint(20) DEFAULT NULL,
  `is_deleted` int(4) DEFAULT '0' COMMENT '是否删除：0：否；1：是；',
  `checktime` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `oauth_union_id` varchar(255) DEFAULT NULL,
  `last_open_id` varchar(255) DEFAULT NULL COMMENT '最近一次openId记录',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`) USING BTREE,
  KEY `idx_oauth_open_id` (`oauth_open_id`) USING BTREE,
  KEY `idx_oauth_union_id` (`oauth_union_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='联合登录表';

/*Data for the table `u_union_login` */

/*Table structure for table `u_user` */

DROP TABLE IF EXISTS `u_user`;

CREATE TABLE `u_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `original_id` varchar(60) DEFAULT NULL COMMENT '数据导入原始id',
  `type` int(4) DEFAULT '0' COMMENT '1：后台运营人员；2：商家主账号；3：商家子账号；4会员 5企业用户 6用户管理员  目前只有1,4,5',
  `identity_type` int(4) DEFAULT '0' COMMENT '1.物业，2餐饮',
  `parent_id` bigint(20) NOT NULL DEFAULT '0',
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `password` varchar(60) DEFAULT NULL,
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `company_name` varchar(255) DEFAULT NULL COMMENT '公司名称',
  `contact_person` varchar(255) DEFAULT NULL COMMENT '负责人',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机',
  `telephone` varchar(20) DEFAULT NULL COMMENT '固定电话',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `status` int(4) DEFAULT '0' COMMENT '状态：0：待审核；1：审核通过；2：审核不通过；',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `points` decimal(12,2) DEFAULT NULL COMMENT 'points`',
  `sex` int(11) DEFAULT NULL COMMENT '性别',
  `head_pic_url` varchar(255) DEFAULT NULL COMMENT '头像url',
  `birthday` timestamp NULL DEFAULT NULL COMMENT '生日',
  `user_province` varchar(60) DEFAULT NULL COMMENT '省份',
  `user_city` varchar(60) DEFAULT NULL COMMENT '市',
  `user_region` varchar(60) DEFAULT NULL COMMENT '区域',
  `user_address` varchar(60) DEFAULT NULL COMMENT '用户地址',
  `check_time` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `check_user_id` bigint(20) DEFAULT NULL COMMENT '审核人id',
  `identity_card_name` varchar(60) DEFAULT NULL COMMENT '真实姓名',
  `is_certification` int(4) DEFAULT '0' COMMENT '是否实名认证：默认0未认证，1认证',
  `legal_person_name` varchar(120) DEFAULT NULL COMMENT '法人姓名',
  `legal_personNo_number` varchar(60) DEFAULT NULL COMMENT '法人证件号码',
  `organization_code` varchar(40) DEFAULT NULL COMMENT '组织机构代码',
  `business_license_number` varchar(40) DEFAULT NULL COMMENT '营业执照号码',
  `business_license_url` varchar(1200) DEFAULT NULL COMMENT '营业执照url',
  `company_type` int(11) DEFAULT '0' COMMENT '公司类型',
  `business_scope` varchar(2000) DEFAULT NULL COMMENT '经营范围',
  `business_start` timestamp NULL DEFAULT NULL COMMENT '经营开始时间',
  `business_end` timestamp NULL DEFAULT NULL COMMENT '经营结束时间',
  `registered_address` varchar(1200) DEFAULT NULL COMMENT '商家注册地址',
  `registered_capital` varchar(1200) DEFAULT NULL COMMENT '商家注册资金',
  `population` int(11) DEFAULT '0' COMMENT '商家总人数',
  `is_available` int(11) DEFAULT NULL COMMENT '是否可用:默认0否;1是',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除:默认0未删除;1已删除',
  `version_no` int(11) DEFAULT '0' COMMENT '版本号:默认0,每次更新+1',
  `create_userid` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_username` varchar(100) DEFAULT NULL COMMENT '创建人姓名',
  `create_userip` varchar(60) DEFAULT NULL COMMENT '创建人IP',
  `create_usermac` varchar(60) DEFAULT NULL COMMENT '创建人MAC地址',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间-应用操作时间',
  `create_time_db` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-数据库操作时间',
  `server_ip` varchar(60) DEFAULT NULL COMMENT '服务器IP',
  `update_userid` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_username` varchar(100) DEFAULT NULL COMMENT '最后修改人姓名',
  `update_userip` varchar(60) DEFAULT NULL COMMENT '最后修改人IP',
  `update_usermac` varchar(60) DEFAULT NULL COMMENT '最后修改人MAC',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '最后修改时间',
  `update_time_db` timestamp NULL DEFAULT NULL COMMENT '最后修改时间-数据库默认写入时间',
  `client_versionno` varchar(40) DEFAULT NULL COMMENT '客户端程序的版本号',
  `company_id` bigint(20) DEFAULT NULL COMMENT '公司id',
  `birthday_update_count` int(11) DEFAULT NULL COMMENT '生日被修改的次数',
  `qq` bigint(20) DEFAULT NULL,
  `source` int(11) DEFAULT '0' COMMENT '数据来源： 0注册会员 1手工录入',
  `f_algorithm_version` int(4) DEFAULT NULL COMMENT '前端加密算法版本',
  `b_algorithm_version` int(4) DEFAULT NULL COMMENT '后端加密算法版本',
  `f_salt` varchar(32) DEFAULT NULL COMMENT '前端盐值',
  `f_salt_update_time` timestamp NULL DEFAULT NULL COMMENT '前端salt值更新时间',
  `b_salt` varchar(32) DEFAULT NULL COMMENT '后端盐值',
  `b_salt_update_time` timestamp NULL DEFAULT NULL COMMENT '后端salt值更新时间',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '注册平台id',
  `platform_group_id` bigint(20) DEFAULT NULL COMMENT '平台组id',
  `entity_type` int(4) DEFAULT NULL COMMENT '实体type(商家、分销商...)',
  `entity_id` bigint(20) DEFAULT NULL COMMENT '实体id 与entity_type联合使用',
  `employe_num` varchar(60) DEFAULT NULL COMMENT '工号',
  `grade_id` bigint(20) DEFAULT NULL COMMENT '用户等级',
  `name_card_url` varchar(255) DEFAULT NULL COMMENT '名片图地址',
  `industry` varchar(100) DEFAULT NULL COMMENT '行业',
  `profession` varchar(60) DEFAULT NULL COMMENT '职业',
  `referee_mobile` varchar(60) DEFAULT NULL COMMENT '推荐人手机',
  `open_id` varchar(64) DEFAULT NULL COMMENT '微信登录时候的openId',
  PRIMARY KEY (`id`),
  KEY `username` (`username`) USING BTREE,
  KEY `company_id` (`company_id`) USING BTREE,
  KEY `idx_mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=119 DEFAULT CHARSET=utf8 COMMENT='用户表';

