/*Table structure for table `u_user_ext` */

DROP TABLE IF EXISTS `u_user_ext`;

CREATE TABLE `u_user_ext` (
  `id` bigint(20) NOT NULL,
  `user_id` bigint(20) DEFAULT NULL,
  `ext_key` varchar(255) DEFAULT NULL,
  `ext_value` varchar(255) DEFAULT NULL,
  `show_name` varchar(255) DEFAULT NULL,
  KEY `idx_user_ext_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `u_user_ext` */

/*Table structure for table `u_user_identity_card` */

DROP TABLE IF EXISTS `u_user_identity_card`;

CREATE TABLE `u_user_identity_card` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL,
  `identity_card_name` varchar(255) NOT NULL COMMENT '姓名',
  `identity_card_number` varchar(255) NOT NULL COMMENT '身份证号码',
  `identity_card_front_url` varchar(255) DEFAULT NULL COMMENT '身份证正面照片url',
  `identity_card_back_url` varchar(255) DEFAULT NULL COMMENT '身份证反面照片url',
  `status` int(4) DEFAULT '0' COMMENT '状态：0：待审核；1：审核通过；2：审核不通过；',
  `notpass_code` int(20) DEFAULT NULL COMMENT '审核不通过状态码',
  `notpass_message` varchar(255) DEFAULT NULL COMMENT '审核不通过原因',
  `is_available` int(11) DEFAULT NULL COMMENT '是否可用:默认0否;1是',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除:默认0未删除;1已删除',
  `version_no` int(11) DEFAULT '0' COMMENT '版本号:默认0,每次更新+1',
  `create_userid` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_username` varchar(100) DEFAULT NULL COMMENT '创建人姓名',
  `create_userip` varchar(60) DEFAULT NULL COMMENT '创建人IP',
  `create_usermac` varchar(60) DEFAULT NULL COMMENT '创建人MAC地址',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间-应用操作时间',
  `create_time_db` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-数据库操作时间',
  `server_ip` varchar(60) DEFAULT NULL COMMENT '服务器IP',
  `update_userid` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_username` varchar(100) DEFAULT NULL COMMENT '最后修改人姓名',
  `update_userip` varchar(60) DEFAULT NULL COMMENT '最后修改人IP',
  `update_usermac` varchar(60) DEFAULT NULL COMMENT '最后修改人MAC',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '最后修改时间',
  `update_time_db` timestamp NULL DEFAULT NULL COMMENT '最后修改时间-数据库默认写入时间',
  `client_versionno` varchar(40) DEFAULT NULL COMMENT '客户端程序的版本号',
  `company_id` bigint(20) DEFAULT NULL COMMENT '公司id',
  `identity_card_hand_url` varchar(255) DEFAULT NULL COMMENT '手持证件照片url',
  `type` int(11) DEFAULT NULL COMMENT '证件类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户身份证信息';

/*Data for the table `u_user_identity_card` */

/*Table structure for table `u_user_login` */

DROP TABLE IF EXISTS `u_user_login`;

CREATE TABLE `u_user_login` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `login_result` int(4) DEFAULT NULL COMMENT '登陆结果',
  `login_time` timestamp NULL DEFAULT NULL COMMENT '登陆时间',
  `ip` varchar(64) DEFAULT NULL COMMENT 'ip',
  `browser` varchar(2000) DEFAULT NULL COMMENT '浏览器信息',
  `is_available` int(11) DEFAULT NULL COMMENT '是否可用:默认0否;1是',
  `is_deleted` int(11) DEFAULT '0' COMMENT '是否逻辑删除:默认0未删除;1已删除',
  `version_no` int(11) DEFAULT '0' COMMENT '版本号:默认0,每次更新+1',
  `create_userid` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_username` varchar(100) DEFAULT NULL COMMENT '创建人姓名',
  `create_userip` varchar(60) DEFAULT NULL COMMENT '创建人IP',
  `create_usermac` varchar(60) DEFAULT NULL COMMENT '创建人MAC地址',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间-应用操作时间',
  `create_time_db` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-数据库操作时间',
  `server_ip` varchar(60) DEFAULT NULL COMMENT '服务器IP',
  `update_userid` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_username` varchar(100) DEFAULT NULL COMMENT '最后修改人姓名',
  `update_userip` varchar(60) DEFAULT NULL COMMENT '最后修改人IP',
  `update_usermac` varchar(60) DEFAULT NULL COMMENT '最后修改人MAC',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '最后修改时间',
  `update_time_db` timestamp NULL DEFAULT NULL COMMENT '最后修改时间-数据库默认写入时间',
  `client_versionno` varchar(40) DEFAULT NULL COMMENT '客户端程序的版本号',
  `company_id` bigint(20) DEFAULT NULL COMMENT '公司id',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`) USING BTREE,
  KEY `idx_user_login_create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=932 DEFAULT CHARSET=utf8 COMMENT='用户登录日志表';

